import ExploreBar from '../../components/ExploreBar'
import SignUpBar from '../../components/SignUpBar'
import Feed from '../../components/Feed'
import './styles.css'
import { useContext } from "react";
import { UserContext } from "../../Contexts/UserContext";

export default function Home() {
  const getProfileData = function (userId) {
    if (!userId) {
      axios({
        method: "GET",
        withCredentials: true,
        url: "http://localhost:3001/profile",
      }).then((res) => {
        console.log(res.data);
        setData(res.data);
      });
    } else {
      axios({
        method: "GET",
        withCredentials: true,
        url: "http://localhost:3001/profile/" + userId,
      }).then((res) => {
        setData(res.data);
        // console.log(data.bioPhotoId);
      });
    }
  };
  const {user, setUser} = useContext(UserContext);
  return(
    <div className="main_grid">
      <div className="main_content">
        <Feed />
      </div>
      <div className="sidebar">
        <ExploreBar/>
      </div>
      <div className="signupbar">
        <SignUpBar />
        <pre>{JSON.stringify(user, null, 2)}</pre>
        <button onClick={async () => {
          const user = await login()
          setUser(user)
        }
        }>Login</button>
        <p className="project_text">This is a project by <a  className="name_text" href="www.github.com/philsmithies"><span>Phil Smithies.</span></a></p>
      </div>
    </div>
  )
}
